def removeDuplicates(S: str):
    if len(S) < 2:
        return S

    t1 = [S[0]]

    for i in range(1, len(S)):
        if t1 ==[]:
            t1.append(S[i])
        else:
            if S[i] == t1[-1]:
                t1.pop()
            else:
                t1.append(S[i])

    return "".join(t1)



print(removeDuplicates("abbaca"))
print(removeDuplicates("b"))
print(removeDuplicates(""))
